// list of users

import React, {Component} from 'react';
import { Table } from 'semantic-ui-react';
import './UserList.css';


class UserList extends Component{

    constructor(props){
        super(props);
    };

    render(){
        return(

            <div className='userList'>

            <Table>
            <Table.Header>
                <Table.Row>
                    <Table.HeaderCell>User</Table.HeaderCell>
                </Table.Row>
            </Table.Header>

            <Table.Body>
                <Table.Row>
                    <Table.Cell selectable>
                        <a href="#">Person1</a>
                    </Table.Cell>

                </Table.Row>
                <Table.Row>
                    Person2
                </Table.Row>



            </Table.Body>
            </Table>

            </div>




        );
    }





};

export default UserList;
